    inv_id = datapoint[0] + "_" + datapoint[2] + "_inv"
    mds = datapoint[3]
    inv_mds = datapoint[4]
    xr = datapoint[5]
    xt = datapoint[6]
    ixr = datapoint[7]
    ixt = datapoint[8]
    gf = datapoint[1]
    field_power = ""

    if "2^8" in gf:
        field_power = 8
    if "2^4"  in gf:
        field_power = 4
    
